INSERT INTO `glpi_tickets` VALUES (1,0,'La web no carga: Sale pantalla \"Welcome to nginx\"','2025-11-26 18:31:44',NULL,NULL,NULL,'2025-11-26 18:31:44',11,1,11,1,'<p>Al intentar entrar a la p├ígina principal (localhost), no aparece la aplicaci├│n. Solo se ve un mensaje por defecto de Nginx. Se necesita acceso urgente.</p>',5,3,4,1,1,1,0,0,0,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,'2025-11-26 18:31:44',1,NULL),(2,0,'Error al consultar usuarios (API 404)','2025-11-26 18:34:23',NULL,NULL,NULL,'2025-11-26 18:34:23',12,1,12,1,'<p>La p├ígina carga, pero al ver la lista de usuarios sale un error rojo: \"Cannot GET /api/usuarios\". El servidor no encuentra los datos.</p>',4,3,4,2,1,1,0,0,0,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,'2025-11-26 18:34:23',1,NULL),(3,0,'Fallo en compilaci├│n: Node.js versi├│n incompatible','2025-11-26 18:35:44',NULL,NULL,NULL,'2025-11-26 18:35:44',9,1,9,1,'<p>El pipeline de CI/CD falla. Error: \"The Angular CLI requires a minimum Node.js version of v18.13\". El contenedor actual tiene Node 16. Se solicita actualizar la imagen base.</p>',3,3,3,1,1,1,0,0,0,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,'2025-11-26 18:35:44',1,''),(4,0,'Error de Build: Bundle size exceeded budget','2025-11-26 18:36:52',NULL,NULL,NULL,'2025-11-26 18:36:52',10,1,10,1,'<p>No se puede generar la versi├│n de producci├│n. Error: \"bundle initial exceeded maximum budget. Budget 1.00 MB, size 1.19 MB\". Se requiere ajustar el <code>angular.json</code>.</p>',2,3,2,1,1,1,0,0,0,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,'2025-11-26 18:36:52',1,''),(5,0,'Servicio mysqld-exporter en bucle de reinicio','2025-11-26 18:38:28',NULL,NULL,'2025-11-26 18:38:28','2025-11-26 18:38:28',8,2,8,1,'<p>El contenedor <code>mysqld-exporter </code>no levanta (State: Restarting). Logs: \"Error parsing host config file... err=no configuration found\". Causa: Falta de credenciales. Soluci├│n: Crear y montar <code>config-exporter.cnf</code>.</p>',4,3,3,3,1,1,0,0,0,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,0,0,0,1,0,0,0,'2025-11-26 18:38:28',1,''),(6,0,'Docker no actualiza cambios (Problema de Cach├®)','2025-11-26 18:39:56',NULL,NULL,'2025-11-26 18:39:56','2025-11-26 18:39:56',8,2,8,1,'<p>A pesar de corregir el Dockerfile, se muestra la versi├│n vieja. Docker est├í reutilizando capas (layers). Acci├│n: Ejecutar build con <code>--no-cache</code>.</p>',3,3,3,4,1,1,0,0,0,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,0,0,0,1,0,0,0,'2025-11-26 18:39:56',1,''),(7,0,'Fallo en carga masiva de datos: Duplicate entry \'L00001\'','2025-11-26 18:41:19',NULL,NULL,NULL,'2025-11-26 18:41:19',10,1,10,1,'<p>La carga de 500k registros falla con Error SQL 1062. Causa: Colisi├│n de datos previos en el volumen con el <code>init.sql</code>.</p>',4,3,4,2,1,1,0,0,0,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,'2025-11-26 18:41:19',1,''),(8,0,'Frontend no conecta con Backend (Error de Networking)','2025-11-26 18:42:34',NULL,NULL,NULL,'2025-11-26 18:42:34',9,1,9,1,'<p><strong>:</strong> El frontend apunta a <code>http://localhost:3000</code>, pero dentro del contenedor \'localhost\' es el mismo contenedor, no el backend.</p>',4,3,4,4,1,1,0,0,0,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,'2025-11-26 18:42:34',1,'');
